import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { Calendar, MapPin, Users, Clock } from 'lucide-react';

const EventDetails = ({ allEvents, theme, onRegister }) => {
  const { id } = useParams();
  const navigate = useNavigate();
  const isDark = theme === 'dark';
  
  // Find the specific event data
  const event = allEvents.find(e => e.id === parseInt(id));

  if (!event) return <div style={{ padding: '20px' }}>Event not found</div>;

  const styles = {
    container: {
      backgroundColor: isDark ? '#0f172a' : '#f8fafc',
      minHeight: '100vh',
      position: 'relative',
      paddingBottom: '160px', // Extra space for the fixed footer
      fontFamily: 'sans-serif'
    },
    topHeader: {
      padding: '16px',
      textAlign: 'center',
      backgroundColor: isDark ? '#1e293b' : '#fff',
      fontWeight: 'bold',
      fontSize: '18px',
      color: isDark ? '#fff' : '#1e293b',
      position: 'sticky',
      top: 0,
      zIndex: 10
    },
    bannerContainer: {
      width: '100%',
      height: '260px', // Height of the top image
      position: 'relative'
    },
    bannerImage: {
      width: '100%',
      height: '100%',
      objectFit: 'cover'
    },
    contentCard: {
      backgroundColor: isDark ? '#1e293b' : '#fff',
      borderTopLeftRadius: '30px',
      borderTopRightRadius: '30px',
      marginTop: '-40px', // This creates the OVERLAP effect
      padding: '24px',
      position: 'relative',
      zIndex: 1, // Sits on top of image
      minHeight: '500px'
    },
    badge: {
      display: 'inline-block',
      backgroundColor: '#5c5cfc',
      color: '#fff',
      padding: '6px 12px',
      borderRadius: '20px',
      fontSize: '12px',
      fontWeight: 'bold',
      marginBottom: '16px',
      textTransform: 'uppercase'
    },
    title: {
      fontSize: '26px',
      fontWeight: '800',
      color: isDark ? '#fff' : '#1e293b',
      marginBottom: '24px',
      lineHeight: '1.3'
    },
    infoRow: {
      display: 'flex',
      gap: '15px',
      marginBottom: '20px',
      alignItems: 'flex-start'
    },
    infoIcon: {
      color: '#64748b', // Grey icon color like screenshot
      marginTop: '2px'
    },
    infoText: {
      display: 'flex',
      flexDirection: 'column'
    },
    label: {
      fontWeight: 'bold',
      fontSize: '16px',
      color: isDark ? '#fff' : '#1e293b',
      marginBottom: '4px'
    },
    subLabel: {
      fontSize: '14px',
      color: '#94a3b8'
    },
    divider: {
      height: '1px',
      backgroundColor: isDark ? '#334155' : '#f1f5f9',
      margin: '24px 0'
    },
    aboutHeader: {
      fontSize: '18px',
      fontWeight: 'bold',
      color: isDark ? '#fff' : '#1e293b',
      marginBottom: '12px'
    },
    description: {
      color: '#94a3b8',
      fontSize: '14px',
      lineHeight: '1.6'
    },
    // The Fixed Bottom Button Area
    footer: {
      position: 'fixed',
      bottom: 0,
      left: 0,
      width: '100%',
      backgroundColor: isDark ? '#1e293b' : '#fff',
      padding: '20px 24px',
      borderTopLeftRadius: '24px',
      borderTopRightRadius: '24px',
      boxShadow: '0 -4px 20px rgba(0,0,0,0.08)',
      zIndex: 100,
      boxSizing: 'border-box'
    },
    registerBtn: {
      width: '100%',
      backgroundColor: '#5c5cfc',
      color: '#fff',
      padding: '16px',
      borderRadius: '12px',
      border: 'none',
      fontSize: '16px',
      fontWeight: 'bold',
      cursor: 'pointer',
      marginBottom: '12px'
    },
    backBtn: {
      width: '100%',
      backgroundColor: 'transparent',
      color: isDark ? '#fff' : '#1e293b',
      padding: '16px',
      borderRadius: '12px',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      fontSize: '16px',
      fontWeight: 'bold',
      cursor: 'pointer'
    }
  };

  return (
    <div style={styles.container}>
      {/* 1. Top White Bar */}
      <div style={styles.topHeader}>Event Details</div>

      {/* 2. Banner Image */}
      <div style={styles.bannerContainer}>
        <img src={event.image} alt={event.title} style={styles.bannerImage} />
        {/* Dark overlay for better text contrast if needed, but not in screenshot */}
        <div style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%', background: 'linear-gradient(to bottom, rgba(0,0,0,0) 60%, rgba(0,0,0,0.2) 100%)' }}></div>
      </div>

      {/* 3. The Overlapping White Card */}
      <div style={styles.contentCard}>
        {/* Badge */}
        <span style={styles.badge}>{event.category || 'WORKSHOP'}</span>

        {/* Title */}
        <h1 style={styles.title}>{event.title}</h1>

        {/* Date Row */}
        <div style={styles.infoRow}>
          <Calendar size={20} style={styles.infoIcon} />
          <div style={styles.infoText}>
            <span style={styles.label}>{event.date.split('·')[0]}</span>
            <span style={styles.subLabel}>{event.date.split('·')[1]}</span>
          </div>
        </div>

        {/* Location Row */}
        <div style={styles.infoRow}>
          <MapPin size={20} style={styles.infoIcon} />
          <div style={styles.infoText}>
            <span style={styles.label}>{event.location}</span>
            <span style={styles.subLabel}>Central Campus</span>
          </div>
        </div>

        {/* Seats Row */}
        <div style={styles.infoRow}>
          <Users size={20} style={styles.infoIcon} />
          <div style={styles.infoText}>
            <span style={styles.label}>45 Seats Left</span>
            <span style={styles.subLabel}>Hurry up, filling fast!</span>
          </div>
        </div>

        <div style={styles.divider}></div>

        {/* About Section */}
        <h3 style={styles.aboutHeader}>About Event</h3>
        <p style={styles.description}>
          Join us for the biggest student tech summit of the year. Explore the latest in AI, Blockchain, and Cloud Computing with industry experts. Lunch and certificates provided for all attendees.
        </p>
      </div>

      {/* 4. Fixed Bottom Buttons */}
      <div style={styles.footer}>
        {!event.isRegistered ? (
          <button 
            style={styles.registerBtn}
            onClick={() => {
              onRegister(event.id);
              navigate('/my-events');
            }}
          >
            Register Now
          </button>
        ) : (
          <button 
            style={{ ...styles.registerBtn, backgroundColor: '#22c55e', cursor: 'default' }}
            disabled
          >
            ✓ Registration Confirmed
          </button>
        )}

        <button 
          style={styles.backBtn} 
          onClick={() => navigate(-1)} // Goes back to previous screen
        >
          Back
        </button>
      </div>
    </div>
  );
};

export default EventDetails;
